	add("penance", "{\"term\":\"penance\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) \u0027penaunce\u0027 from Anglo-norman from Old french (842-ca. 1400) \u0027peneance\u0027 from Latin \u0027paenitentia\u0027 (penitence)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A voluntary self-imposed punishment for a sinful act or wrongdoing. It may be intended to serve as reparation for the act\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Coleridg\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Quoth he, \u0026quot;The man hath \u0027\u0027penance\u0027\u0027 done, / And penance more will do.\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A sacrament in some Christian churches\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"repentanc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"pain; sorrow; sufferin\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Chauce\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Joy or \u0027\u0027penance\u0027\u0027 he feeleth none\", \"priority\":8}]}, \"synonyms\":{}}");

