	add("pence", "{\"term\":\"pence\", \"etymology\":{\"influencers\":[{}], \"languages\":[], \"text\":\"14th century contraction of \u0027penies\u0027 (pennies) collective plural of \u0027penny\u0027 \u0026lt;ref\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the sub-unit of the pound sterling\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pencel", "{\"term\":\"pencel\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027pencel\u0027 reduced form of \u0027penuncel\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small pennon\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Letters of the Kings of chapter\u003d(letter to Piers year_published\u003d1846|page\u003d153|url\u003dhttp://books.google.com/books?id\u003dR4S_U_Pt1bcC|passage\u003d forty trumpet banners of sarsenet; seven hundred and forty \u0027\u0027pensills\u0027\u0027; three hundred and fifty \u0027\u0027pensills\u0027\u0027 of tarter; four standards of sarsenet with boars\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Thomas Penn, \u0027Winter King\u0027, Penguin 2012, p. 86\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Inside Worcester Cathedral, the coffin was transferred to its hearse, a vast, storeyed, wooden structure, painted black and adorned with heraldic escutcheons, badged pennants or ‘\u0027\u0027pencels\u0027\u0027’, silk standards of St George, banners of the royal arms of England and Spain, and of Arthur\u0027s various titles, from Wales to Ponthieu in Normandy\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A lady\u0027s favour or token as worn by a knight\", \"priority\":5}]}, \"synonyms\":{}}");

	add("penchant", "{\"term\":\"penchant\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"{{borrowing|fr|penchant|lang\u003den}}, present participle of \u0027pencher\u0027 (to tilt, to lean) from Middle french (ca. 1400-1600) from Old french (842-ca. 1400) \u0027pengier\u0027 (to tilt, be out of line) from *\u0027\u0027 (pendicāre) a derivative of Latin \u0027pendere\u0027 (to hang, to lean)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"taste, liking, or inclination (for\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"He has a \u0027\u0027penchant\u0027\u0027 for fine wine\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A card game resembling bezique\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"In the game of penchant, any queen and jack of different suits held at the same time\", \"priority\":4}]}, \"synonyms\":{}}");

