	add("pencil", "{\"term\":\"pencil\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman and Old french (842-ca. 1400) {{m|fro|pincil}} (modern {{m|fr|pinceau||paintbrush}}), from Latin {{m|la|pēnicillum}}, diminutive of {{m|la|pēniculus|gloss\u003dbrush}}, from noun {{m|la|penis|gloss\u003dtail}} + diminutive suffix {{m|la|-culus}}.See also Old french (842-ca. 1400) {{m|fro|pincel}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A paintbrush\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1590\u0027\u0027, \u0027The Faerie Queene\u0027, III.0\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"But living art may not least part expresse, / Nor life-resembling \u0027\u0027pencill\u0027\u0027 it can paynt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"II.17\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"why is it not lawfull for every man to pourtray himself with his pen, as it was for him to doe it with a \u0027\u0027pensell\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Writing utensil that uses graphite (commonly referred to as lead). Regular pencils usually have a graphite shaft surrounded by wood. Also available in a mechanical version where the graphite length can be adjusted and sharpening is not needed\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A family of geometric objects with a common property, such as the set of lines that pass through a given point in a projective plane\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An aggregate or collection of rays of light, especially when diverging from, or converging to, a point\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1863\u0027\u0027, \u0027The Civil Engineer and Architect\u0027s Journal\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"When, by the \u0027\u0027pencil\u0027\u0027 becoming oblique to the surface, the vergency produced on the pencil becomes changed, the primary and secondary focal points, V and H, separate\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A small medicated bougie\", \"priority\":11}]}, \"synonyms\":{}}");

	add("pendeloque", "{\"term\":\"pendeloque\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027pendeloque\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A drop-shaped diamond or other gem used as a pendant\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The chandelier\u0027s \u0027\u0027pendeloque\u0027\u0027 was a large brilliant diamond\", \"priority\":2}]}, \"synonyms\":{}}");

