	add("penelope", "{\"term\":\"penelope\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003dmul}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The faithful wife of Odysseus\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1608\u0027\u0027 William Shakespeare: \u0027Coriolanus: Act I, Scene III\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"You would be another \u0027\u0027Penelope\u0027\u0027; yet, they say, all the yarn she spun in Ulysses\u0027 absence did but fill Ithaca with moths\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027 , \u0027Runaway:Stories\u0027, Knopf (2004), page 93\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"quot;What\u0027s her name?\u0026quot; He meant the baby\u0027s. \u0026quot;\u0027\u0027Penelope\u0027\u0027. We\u0027re never going to call her Penny. \u0027\u0027Penelope\u0027\u0027.\u0026quot; - - - \u0026quot;\u0026quot;Oh. Well, it\u0027s \u0027\u0027Penelope\u0027\u0027 Henderson - Porteous I guess. Or Porteous - Henderson. But maybe that\u0027s too much of a mouthful, when she\u0027s already called \u0027\u0027Penelope\u0027\u0027? We knew that we wanted \u0027\u0027Penelope\u0027\u0027. We\u0027ll have to settle it somehow.\u0026quot\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A town in Texas\", \"priority\":6}]}, \"synonyms\":{}}");

