	add("penetralia", "{\"term\":\"penetralia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The innermost, secret or hidden parts\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The innermost parts of a building, such as a shrine, recess or a sanctuary within a temple\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1748,\u0027\u0027 Tobias George Smollett, \u0027The Adventures of Roderick Random\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I believe, had I been in the inmost recesses of my habitation--the very \u0027\u0027penetralia\u0027\u0027--your eagerness would have surmounted bolts, bars, decency, and everything\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1857\u0027\u0027, Anthony Trollope, Barchester Towers\u0027, Volume the Second, page 5 (ISBN 1857150570\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"He wished to be what he called \u0026quot;safe\u0026quot; with all those whom he had admitted to the \u0027\u0027penetralia\u0027\u0027 of his house and heart\", \"priority\":6}]}, \"synonyms\":{}}");

