	add("penetration", "{\"term\":\"penetration\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027pénétration\u0027 and its source, Latin \u0027penetrātiō\u0027 from the participle stem of \u0027penetro\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of penetrating something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any \u0027\u0027penetration\u0027\u0027, however slight, is sufficient to complete the offense\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Specifically, the insertion of the penis (or similar object) during sexual intercourse\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The act of penetrating a given situation with the mind or faculties; perception, discernment\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1817\u0027\u0027, \u0027Rob Roy\u0027, XVI\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"my observations of her looks and actions became acutely sharpened, and that to a degree which, notwithstanding my efforts to conceal it, could not escape her \u0027\u0027penetration\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A number or fraction that represents how many cards/decks will be dealt before shuffling, in contrast to the total number of cards/decks in play\", \"priority\":7}]}, \"synonyms\":{}}");

	add("penguin", "{\"term\":\"penguin\", \"etymology\":{\"influencers\":[], \"languages\":[\"Welsh\", \"English\", \"Latin\"], \"text\":\"Unknown origin\u0026lt;ref\u0026gt;T.F. Hoad, \u0027Concise Dictionary of English Etymology\u0027, ISBN 978-0-19-283098-2; headword \u0027penguin\u0027\u0026lt;/ref\u0026gt;. Possibly from Welsh \u0027lang\u003dcy\u0027 (\u0026quot;head\u0026quot;) and \u0027lang\u003dcy\u0027 (\u0026quot;white\u0026quot;), or from Latin \u0027lang\u003dla\u0027 (\u0026quot;fat\u0026quot;). See Citations:penguin|citations and [http://en.wikipedia.org/wiki/Pengui. Etymology the Wikipedia page].\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several flightless sea birds, of order \u0027Sphenisciformes\u0027, found in the Southern Hemisphere; marked by their usual upright stance, walking on short legs, and (generally) their stark black and white plumage\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1638\u0027\u0027, \u0027Some Yeares Travels\u0027, I\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Here are also birds cal\u0027d \u0027\u0027\u0027Pen-gwins\u0027\u0027\u0027 (white-head in \u0027Welch\u0027) like Pigmies walking upright, their finns or wings hanging very orderly downe like sleeves\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A nun (because of the black and white habit\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A type of catch where the palm of the hand is facing towards the leg with the arm stretched downward, resembling the flipper of a penguin\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A spiny bromeliad with egg-shaped fleshy fruit\", \"priority\":6}]}, \"synonyms\":{}}");

