	add("pennycress", "{\"term\":\"pennycress\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|penny|cress|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several plants, of the genus \u0027Thlaspi\u0027, that have flattened seedpods (in the form of an old penny\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pennyroyal", "{\"term\":\"pennyroyal\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\", \"anglo-norman\"], \"text\":\"Apparently an alteration (after \u0027\u0027 of Anglo-norman \u0027puliol royal\u0027 from Latin \u0027pulegium\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a plant of the mint family, formerly much used in various medicinal treatments and as a flea repellant\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1653\u0027\u0027, \u0027The English Physician Enlarged\u0027, Folio Society 2007, p. 216\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Dioscorides says that \u0027\u0027Pennyroyal\u0027\u0027 makes thin, tough phlegm, warms the coldness of any part whereto it is applied, and digests raw or corrupt matter\", \"priority\":3}]}, \"synonyms\":{}}");

	add("penobsquisite", "{\"term\":\"penobsquisite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Penobscot|ite|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A monoclinic-sphenoidal pale yellow mineral containing boron, calcium, chlorine, hydrogen, iron, and oxygen\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pension", "{\"term\":\"pension\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027pencione\u0027 Old french (842-ca. 1400) \u0027pencion\u0027 and their source, Latin \u0027pensio\u0027 from the participle stem of \u0027pendere\u0027 (to weigh)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A wage or fee\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A charge or expense of some kind; a tax\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A regular allowance paid to support a royal favourite, or as patronage of an artist or scholar\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An annuity paid regularly as benefit due to a retired employee, serviceman etc. in consideration of past services, originally and chiefly by a government but also by various private pension schemes\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Many old people depend on their \u0027\u0027pension\u0027\u0027 to pay the bills\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A boarding house or small hotel, especially in continental Europe, which typically offers lodging and certain meals and services\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027pension\u0027\u0027 had somewhat less to offer than a hotel; it was always smaller, and never elegant; it sometimes offered breakfast, and sometimes not\u0027 (John Irving\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A boarding school in France, Belgium, Switzerland, etc\", \"priority\":8}]}, \"synonyms\":{}}");

	add("pensioner", "{\"term\":\"pensioner\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027pensionner\u0027 from Old french (842-ca. 1400) \u0027pensionnier\u0027 from \u0027pensionarius\u0027 Surface etymology is {{suffix|pension|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who lives on a pension\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Someone who is at the age at which one typically receives a pension; an elderly person\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A student who is not dependent on any foundation for support, but pays all university charges; at Oxford called a commoner\", \"priority\":3}]}, \"synonyms\":{}}");

	add("pensiveness", "{\"term\":\"pensiveness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|pensive|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A thoughtful or reflective state, especially if sad or melancholic\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"We left quietly so as not to disturb the widow\u0027s \u0027\u0027pensiveness\", \"priority\":2}]}, \"synonyms\":{}}");

	add("penstroke", "{\"term\":\"penstroke\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|pen|stroke|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a stroke of a pen\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pentachloronitrobenzene", "{\"term\":\"pentachloronitrobenzene\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fungicide formally derived from nitrobenzene; it is an off-white or yellow solid with a musty odour\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pentachromacy", "{\"term\":\"pentachromacy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"penta- + chromacy\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of having five independent channels for conveying color information in the eye\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pentacle", "{\"term\":\"pentacle\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From the French \u0027pentacle\u0027 (a five-pointed star) from \u0027pentaculum\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pentagram, especially a physical one used for magical or mystical purposes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A pentagram enclosed within a circle, especially a physical one\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"page \u003d pageurl \u003d passage \u003d A \u0027\u0027pentacle\u0027\u0027 is a pentagram with a circle drawn around it\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"page \u003d pageurl \u003d passage \u003d The pentagram becomes a \u0027\u0027pentacle\u0027\u0027 when it is enclosed within a circle and inscribed on a disc or stone\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A talisman of parchment, sheet metal or other substance marked with a magic symbol or symbols, used in magical evocation\", \"priority\":5}]}, \"synonyms\":{}}");

	add("pentacube", "{\"term\":\"pentacube\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|penta|cube|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A polycube composed of five cubes\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pentad", "{\"term\":\"pentad\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|pent|ad|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a group or series of five thing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any element, atom, or radical having a valence of five, or which can be combined with, substituted for, or compared with, five atoms of hydrogen or other monad\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Nitrogen is a \u0027\u0027pentad\u0027\u0027 in the ammonium compounds\", \"priority\":3}]}, \"synonyms\":{}}");

	add("pentadecagon", "{\"term\":\"pentadecagon\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a polygon with fifteen side\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027: In ⊙ \u0027O\u0027, draw chord \u0027AB\u0027 equal to \u0027r\u0027. Draw chord \u0027AC\u0027 equal to \u0027Vt\u0027 (which is the side of a regular decagon). \u0027CB\u0027 is now one side of the regular \u0027\u0027pentadecagon\u0027\u0027. — Steven Atiyah, \u0027Essentials of Geometry\u0027 (Trafford 2003, p. 357\", \"priority\":2}]}, \"synonyms\":{}}");

	add("pentafluoride", "{\"term\":\"pentafluoride\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|penta|fluoride|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any fluoride containing five fluorine atoms in each molecule\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pentagonite", "{\"term\":\"pentagonite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From the fiveling twins that are common in this material\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A silicate of calcium and vanadium found in basalts and tuffs\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pentagram", "{\"term\":\"pentagram\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027πεντάγραμμον\u0027 noun form of the adjectives \u0027πεντάγραμμος\u0027 and \u0027πεντέγραμμος\u0027 (five-lined, having five lines) Equivalent to \u0027penta\u0027 + \u0027gram\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The shape of a five-pointed star constructed of five intersecting lines meeting at the vertices, such that a central pentagon and five surrounding isosceles triangles are formed; often with magical connotations; a 5/2 (or 5/3) star polygon\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1871\u0027\u0027, W. J. C. Miller (editor), \u0027Mathematical Questions and Solutions\u0027, Volume XV, [https://books.google.com.au/books?id\u003d6C8-AQAAMAAJ\u0026amp;pg\u003dPA46\u0026amp;dq\u003d%22pentagrams%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dd1SJVNGGLYLQmwXOnIHIDg\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22pentagrams%22\u0026amp;f\u003dfalse page 47\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Prove that the circles so belonging to the 6 \u0027\u0027pentagrams\u0027\u0027 formed by 6 lines meet in a point, and so on; the series of theorems being interminable\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Christopher Penczak, \u0027The Temple of High Witchcraft: Ceremonies, Spheres, and the Witches\u0027 Qabalah\u0027, [https://books.google.com.au/books?id\u003du0uHNX5c9i4C\u0026amp;pg\u003dPA345\u0026amp;dq\u003d%22pentagrams%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dMCSJVP23LJLr8AWC6YH4Ag\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22pentagrams%22\u0026amp;f\u003dfalse page 345\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The passive \u0027\u0027pentagrams\u0027\u0027 of spirit are drawn first in the quarters of the passive elements—water and earth—and likewise followed by the appropriate traditional elemental \u0027\u0027pentagram\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, John Barnes, \u0027Gems of Geometry\u0027, [https://books.google.com.au/books?id\u003d7YCUBUd-4BQC\u0026amp;pg\u003dPA59\u0026amp;dq\u003d%22pentagrams%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dMCSJVP23LJLr8AWC6YH4Ag\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22pentagrams%22\u0026amp;f\u003dfalse page 59\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Four figures involve 12 \u0027\u0027pentagrams\u0027\u0027 arranged as in the faces of a dodecahedron with their vertices touching\", \"priority\":10}]}, \"synonyms\":{}}");

	add("pentahedron", "{\"term\":\"pentahedron\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|penta|hedron|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A solid geometric figure with five faces\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pentahydroborite", "{\"term\":\"pentahydroborite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A basic calcium borate found in skarn minerals\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pentail", "{\"term\":\"pentail\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|pen|tail|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An insectivore (\u0027Ptilocercus lowii\u0027) of Borneo, with a very long, quill-shaped tail, which is scaly at the base and plumose at the tip\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pentakisphosphate", "{\"term\":\"pentakisphosphate\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|pentakis|phosphate|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A compound having five simple phosphate groups\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pental", "{\"term\":\"pental\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Abbreviated from thiopental.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"w:sodium sodium thiopental, a common anesthetic\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pentalemma", "{\"term\":\"pentalemma\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|penta|lemma|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An argument analogous to a dilemma, but involving five alternatives\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pentamer", "{\"term\":\"pentamer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|penta|mer|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An oligomer having five subunits\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pentanal", "{\"term\":\"pentanal\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An alkyl aldehyde with molecular formula C\u0026lt;sub\u0026gt;5\u0026lt;/sub\u0026gt;H\u0026lt;sub\u0026gt;10\u0026lt;/sub\u0026gt;O, used in flavourings, resin chemistry, and rubber accelerators\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pentaphosphate", "{\"term\":\"pentaphosphate\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|penta|phosphate|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A compound having five phosphate group\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A polymeric anion composed of five linked phosphate groups; any salt containing this anion\", \"priority\":2}]}, \"synonyms\":{}}");

	add("pentaprism", "{\"term\":\"pentaprism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|penta|prism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A five-sided prism used in the viewfinder of some single-lens reflex cameras\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pentarchy", "{\"term\":\"pentarchy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|pent|archy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Government by five persons\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A governing body consisting of five persons\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A federation of five nations, each under its own government or ruler\", \"priority\":3}]}, \"synonyms\":{}}");

	add("pentateuch", "{\"term\":\"pentateuch\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027πεντάτευχος\u0027 () from Ancient greek (to 1453) \u0027πέντε\u0027 (five) + \u0027τεῦχος\u0027 (tool, scroll, book)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The Torah: the first five books of the Bible: Genesis, Exodus, Leviticus, Numbers, and Deuteronomy\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pentathlete", "{\"term\":\"pentathlete\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An athlete who competes in the pentathlon\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pentazole", "{\"term\":\"pentazole\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|penta|azole|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The five-membered homocyclic compound containing five nitrogen atoms and two double bond\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any organic derivative of this compound; they are explosive\", \"priority\":2}]}, \"synonyms\":{}}");

	add("pentecost", "{\"term\":\"pentecost\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) {{m|grc|πεντηκοστή||fiftieth}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Jewish festival (also known as Shavuot, the Feast of Weeks) seven weeks after the feast of Firstfruits or Yom Habikkurim, originally a harvest festival but, since the destruction of the Temple, also commemorating the anniversary of the giving of the Ten Commandments to Moses and the Israelites at Mount Sinai. [See Wikipedia article on Shavuot for further information on, and chronology of, these feasts\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1611:\u0027\u0027 \u0027Bible, King James version, Acts of the Apostles 2:1\u0027 - And when the day of \u0027\u0027Pentecost\u0027\u0027 was fully come, they were all with one accord in one place\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1854:\u0027\u0027 Walter Farquhar Hook, \u0027A Church Dictionary\u0027 - The first lesson for the morning contains the law of the Jewish \u0027\u0027Pentecost\u0027\u0027, or Feast of Weeks, which was a type of ours\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2005:\u0027\u0027 Alfred J Kolatch, \u0027A Handbook for the Jewish Home\u0027 - Because Shavuot is celebrated on the fiftieth day after the advent of Passover, it has been called \u0027\u0027Pentecost\u0027\u0027, a Greek word meaning “fiftieth [day]\u0026quot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The particular (Jewish) Pentecost 49 days (inclusive) after the resurrection of Jesus on the (Jewish) Day of First Fruits, when (in Christian teaching) the Holy Spirit descended upon the Apostles with miraculous effects including the ability to explain the Gospel intelligibly in languages they did not know; or a similar occasion since\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1762:\u0027\u0027 Voltaire, \u0027William Vade\u0027 included in \u0027Works\u0027 - He spoke either Latin or Welsh; and the Sicambri spoke the antient Teutonic. Remi, in all appearance, renewed the miracle of the \u0027\u0027Pentecost\u0027\u0027: \u0027Et unusquisquis intendebat linguam suam\u0027, And each understood his own language\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1786:\u0027\u0027 Joseph Priestley, \u0027An History of Early Opinions Concerning Jesus Christ: Compiled from Original Writers; Proving that the Christian Church was at first Unitarian\u0027 - If it be supposed that the divinity of Christ was unknown to the apostles till the day of \u0027\u0027Pentecost\u0027\u0027 ... we have no account of any such discovery having been made\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2005:\u0027\u0027 Frank J Lechner, John Boli, \u0027World Culture: Origins and Consequences\u0027 - They think a new \u0027\u0027Pentecost\u0027\u0027 is afoot, in which the Holy Spirit brings millions the good news of salvation in the hereafter and real blessings in the here and now\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Christian festival (also known as Whitsun or Whitsunday), which commemorates the descent of the Holy Spirit upon the Apostles (see above definition\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1797:\u0027\u0027 Richard Burn, Simon Fraser, \u0027Ecclesiastical Law\u0027 - Spiritual profits, commonly called whitsun-farthings, ... offered at the time of \u0027\u0027pentecost\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2005:\u0027\u0027 Edward Kessler, Neil Wenborn (editors), \u0027A Dictionary of Jewish-Christian Relations\u0027 - Shavuot is linked to Passover in the same way that \u0027\u0027Pentecost\u0027\u0027 is linked to Easter, by a period of seven weeks\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2006:\u0027\u0027 Alister E McGrath, \u0027Christianity: An Introduction\u0027 - The specific event which is commemorated at \u0027\u0027Pentecost\u0027\u0027 is the coming of the Holy Spirit, which is described in the Acts of the Apostles\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Pentecostal manifestation, such as in a church service\", \"priority\":13}]}, \"synonyms\":{}}");

	add("pentecostalism", "{\"term\":\"pentecostalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Pentecostal|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Christian religious movement that emphasizes the Holy Spirit and is known for speaking in tongues\", \"priority\":1}]}, \"synonyms\":{}}");

	add("penthouse", "{\"term\":\"penthouse\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027pentiz|lang\u003dfro\u0027 () from \u0027apendiz\u0027 (appentice) ultimately from a suffixed form of Latin \u0027appendō\u0027 (lang\u003dla) Altered by folk etymology to appear to be a compound of {{m|en|house}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An outhouse or other structure (especially one with a sloping roof) attached to the outside wall of a building\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1826\u0027\u0027: William Eusebius Andrews, \u0027Review of Fox\u0027s Book of Martyrs\u0027, WE Andrews, pp. 386-7\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"At length, recommending himself to God, he let go one end of his cord, and suffered himself to fall down upon an old shed or \u0027\u0027penthouse\u0027\u0027, which, with the weight of his body, fell in with great noise\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An apartment or suite found on an upper floor, or floors, of a tall building, especially one that is expensive or luxurious with panoramic views. Sometimes these are located just under \u0026quot;penthouse mechanical\u0026quot; floors\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027: Mary Ellen Waithe, \u0027Contemporary Women Philosophers: 1900-Today\u0027, Springer, p. 214\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Night of January 16th\u0027 is the story of a woman on trial for pushing her wealthy boss-lover from a Manhattan \u0027\u0027penthouse\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Any of the sloping roofs at the side of a real tennis court\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2005,\u0027\u0027 Tony Collins (ed.), \u0027Encyclopaedia of Traditional British Rural Sports\u0027, Routledge, page 262\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"An odd derivative of real tennis lasted until the latter part of the eighteenth century at Rattray in Perthshire. It was played in the churchyard by two pairs of men, and the method for starting the play was to throw the ball onto the church roof, using it like the sloping \u0027\u0027penthouse\u0027\u0027 of the tennis court\", \"priority\":9}]}, \"synonyms\":{}}");

	add("pentose", "{\"term\":\"pentose\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|penta|ose|gloss1\u003dfive|gloss2\u003dsugar|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sugar or saccharide containing five carbon atoms\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Ribose, found in RNA, is a common \u0027\u0027pentose\", \"priority\":2}]}, \"synonyms\":{}}");

	add("pentostatin", "{\"term\":\"pentostatin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A particular drug, isolated from \u0027Streptomyces antibioticus\u0027, used in chemotherapy\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pentoxyverine", "{\"term\":\"pentoxyverine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cough suppressant\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pentrite", "{\"term\":\"pentrite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The explosive pentaerythritol tetranitrate\", \"priority\":1}]}, \"synonyms\":{}}");

